use std::sync::{RwLock, Arc};

use artewald_engine_lib::{voxel::{Chunk, Material}, threadpool::ThreadPoolHelper};
use nalgebra::{Vector4, Vector3, Vector2};


pub fn create_simple_scene(chunk: &mut Chunk, thread_pool: Arc<RwLock<ThreadPoolHelper>>) {
    let mut green_material = Material::new_default();
    green_material.color = Vector4::new(0.0, 1.0, 0.0, 1.0);
    green_material.smoothness = 1.0;
    green_material.specular_probability = 0.15;
    let mut red_material = Material::new_default();
    red_material.color = Vector4::new(1.0, 0.0, 0.0, 1.0);
    let mut light_material = Material::new_default();
    light_material.emissive_color = Vector3::new(1.0, 1.0, 1.0);
    light_material.emissive_strength = 1.0;

    chunk.fill_voxels(
        thread_pool.clone(),
        Vector3::new(Vector2::new(5, 10), Vector2::new(0, 5), Vector2::new(3, 15)),
        red_material,
    );
    chunk.fill_voxels(
        thread_pool.clone(),
        Vector3::new(Vector2::new(0, 3), Vector2::new(2, 5), Vector2::new(5, 10)),
        green_material,
    );
	// chunk.fill_voxels(
	// 	thread_pool.clone(),
	// 	Vector3::new(
	// 		Vector2::new(0, 1),
	// 		Vector2::new(0, 1),
	// 		Vector2::new(0, 1),
	// 	),
	// 	red_material,
	// );
	// chunk.fill_voxels(
	// 	thread_pool.clone(),
	// 	Vector3::new(
	// 		Vector2::new(1, 2),
	// 		Vector2::new(1, 2),
	// 		Vector2::new(1, 2),
	// 	),
	// 	green_material,
	// );
    chunk.fill_voxels(
        thread_pool.clone(),
        Vector3::new(
            Vector2::new(0, 15),
            Vector2::new(10, 11),
            Vector2::new(0, 20),
        ),
        light_material,
    );
}

